import React from 'react';
import './Header.css';

const Header = () => {
  return (
    <div className="Header">
      <div className="Grid">
        <div className="Logo"><img src="/logo.png"></img></div>
        <div className="NavLinks">nav</div>
        <div className="ActionButton"><button>Call Now</button></div>
      </div>
    </div>
  );
}

export default Header;
